"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F77674%7EDERM%2F68498%7EDERM%2F54221&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
