"   <div class=\"lgnd\">",
"    Results of the Beta Blocker Heart Attack Trial which randomized 3837 patients with an acute myocardial infarction to propranolol or placebo. At an average follow-up of 25 months, propranolol significantly reduced total, cardiovascular, and sudden death mortality and reduced the incidence of nonfatal infarction and all coronary events. Benefit occurred in all patient groups, but was more marked in those with heart failure (HF).",
"    <div class=\"footnotes\">",
